import React from "react";

const Introduce = () => {
  return (
    <div>
      <h1>자기소개</h1>
      <ol>
        <li>이름: 장유빈</li>
        <li>취미: 독서</li>
        <li>최근 관심사: 2학기 청강할 과목</li>
      </ol>
    </div>
  );
};

export default Introduce;
